import React,{useRef} from "react";
import {
  Box,
  Grid,
  Typography,
} from "@mui/material";

import ListItem from "./FullWidthTabs";

function Product(props) {
  const ref = useRef(null);
  return (
    <>
      <Box sx={{ px: 5, py: 3 }} ref={props.productRef} id="divProduct">
        <Typography variant="h4" textAlign="center">
          Product
        </Typography>
        <Box>
          <ListItem />
        </Box>
        
      </Box>
    </>
  );
}
export default Product;
